ll public posts, terms and related keyphrases, you can generate a CSV file using the %s button below.'=>'Якщо вам потрібен список усіх публічних публікацій, термінів та пов\'язаних із ними ключових слів, ви можете створити файл CSV,  використовуючи кнопку нижче %s.','Export keyphrases to a CSV file'=>'Експортувати ключові слова у файл CSV','You can add or remove columns to be included in the export using the checkboxes below.'=>'Ви можете додавати або видаляти стовпці, які потрібно включити до експорту, використовуючи прапорці нижче.','Export URL'=>'Експортувати URL-адресу','Export title'=>'Експорт заголовка','Export readability score'=>'Експорт читабельності','Please note:'=>'Будь ласка, запиши:','The first row in this file is the header row. This row should be ignored when parsing or importing the data from the export.'=>'Перший рядок у цьому файлі - рядок заголовка. Цей рядок слід ігнорувати при аналізі чи імпорті даних з експорту.','Exporting data can take a long time when there are many posts, pages, public custom post types or terms.'=>'Експортування даних може тривати довгий час, коли існує безліч повідомлень, сторінок, загальнодоступних типів повідомлень або умов.','Plain redirects'=>'Рівні перенаправлення','Regular Expression redirects'=>'Редактор регулярних виразів','Redirects settings'=>'Перенаправлення налаштувань','post_type of a post or the taxonomy of a termtype'=>'тип','seo title'=>'seo title','Export SEO title'=>'Експортувати заголовок SEO','Export meta description'=>'Експорт мета-опису','keyphrase'=>'ключова фраза','keyphrase score'=>'оцінка ключової фрази','Export keyphrases'=>'Експортувати ключові фрази','Export keyphrase scores'=>'Експортувати оцінки ключових фраз','https://yoa.st/2jc'=>'https://yoa.st/2jc','Yoast SEO Premium'=>'Yoast SEO Premium','All redirects have been imported successfully. Go to the %1$sredirects overview%2$s to see the imported redirects.'=>'Усі переспрямування успішно імпортовані. Перейдіть до %1$sогляду переспрямувань%2